import React from 'react';

function Certificates() {
  return (
    <div>
      <h3>Certificates</h3>
      <ul className="bulleted-list">
        <li style={{ listStyleType: 'disc' }}><strong>AWS Solutions Architect Associate Certification (2024.08)</strong></li>
      </ul>
      <ul className="bulleted-list">
        <li style={{ listStyleType: 'disc' }}><strong>GCP Associate Cloud Engineer Certification (2024.07)</strong></li>
      </ul>
    </div>
  );
}

export default Certificates;
